            //Insert data (content and permissions)
            migrationBuilder.Sql("INSERT INTO cms_content_impact(\"Id\", \"Title\", \"Description\", \"Image\", \"CreateDate\") VALUES\r\n('59f9cb50-869a-4b41-b310-71f6a8a110e5', E'DHSC Framework', E'Our platform is one of a select few service providers supporting the UK Government’s short and long-term distribution of medical devices, consumables, reagents, and equipment across the country. The platform manages the storage of goods, provides a secure and user-friendly ordering system, and a means to collect payments in a UK primary care setting. Additionally, with ISO9000 certification for warehousing and 1so9001 for provision of customer-focused activities, the team can distribute medical devices and more to NHS centres, hospitals, and GP surgeries. We provide an adaptive and scalable approach to resource management and a solution that can flex in real time in response to the volume and pace of demand for goods.', E'data:image/png;base64,', '-infinity');");
            migrationBuilder.Sql("INSERT INTO cms_content_impact(\"Id\", \"Title\", \"Description\", \"Image\", \"CreateDate\") VALUES\r\n('6d08a413-1437-4727-b200-50bb6f48ea6a', E'Global Fund', E'Across 22 countries and with data from 800 health facilities, we support The Global Fund to embed a culture of performance management in each country’s health supply chains. We routinely track indicators for on-shelf availability, on-time-in-full delivery, commodities stocked according to plan, and timeliness of facility’s reporting to the LMIS. Our analyses support health programs and the ability of supply chain actors to monitor needs, identify risks, and track trends in individual country logistics operations to help inform systems strengthening priorities. By supporting national program managers in monitoring the availability of essential health commodities and services at different points in the system, we have created an in-depth understanding of whether and how health facilities have adapted to the challenges of COVID-19.', E'data:image/png;base64,', '-infinity');");
            migrationBuilder.Sql("INSERT INTO cms_content_leadership(\"Id\", \"Name\", \"Position\", \"Image\", \"Phone\", \"Email\", \"Bio\", \"Alignment\", \"CreateDate\") VALUES\r\n('ded387cc-e090-41f7-bb94-413c439b342e', E'Dan Rhodes', E'Project Director', E'data:image/png;base64,', E'+1 440-832-1880', E'dan.rhodes@thepalladiumgroup.com', E'Dan has deep and varied experience designing, leading, improving, and scaling supply chain activities, including having held commercial responsibility for portfolios of over $250 million per year and operational leadership of over $750 million per year across 25 countries. He has experience implementing ICL related requirements having been involved in nearly all aspects of the GHSC-Procurement and Supply Management project including leading its’ largest country office. Dan has practical experience effectivelymanaging complex, large-scale USAID contracts with diverse teams, while ensuring compliance and responsiveness. A former United States Marine, he has an advanced degree and management-related certifications.', E'Dan is Palladium’s Vice President responsible for its Procurement, Logistics, and Supply Chain Management Portfolio, delivering work for public and private clients in the health and defense sectors. He previously acted as a Managing Director, Country Director, Project Director, and subject matter expert on the GHSC-Procurement and Supply Management project. He combines technical expertise with multidisciplinary management skills.\\n\\nDan holds a Master’s in Business Administration as well as an undergraduate degree in political science. He has earned certifications as a Project Management Professional, a Certified Performance Technologist, and a Lean Six Sigma Black Belt from the American Society of Quality.\\n\\nAfter leading teams of 200+ United States Marines and 500+ local staff on all aspects of logistics during his military career, Dan became a supply chain professional in the commercial world, conducting assignments of increasing size on behalf of leading logistics providers. He has experience working in most of the current GHSC countries, including the Nigeria country program.', '-infinity');");
            migrationBuilder.Sql("INSERT INTO cms_content_leadership(\"Id\", \"Name\", \"Position\", \"Image\", \"Phone\", \"Email\", \"Bio\", \"Alignment\", \"CreateDate\") VALUES\r\n('32720211-d00a-4d2b-80ec-47e7e4bdcb21', E'Marilyn Noguera', E'Deputy Project Director', E'data:image/png;base64,', E'+1 202-468-6149', E'marilyn.noguera@thepalladiumgroup.com', E'Marilyn has worked at both the country and HQ levels, combining practical delivery with vision, strategy, and technical leadership to consistently achieve results. Having served as a senior technical adviser with JSI, PATH, and Palladium, her work on previous iterations of GHSC includes delivering global technical leadership, five years leading the Mozambique program, overseeing implementation in Nigeria, and providing technical assistance to 20 countries. A highly respected, innovative, and decisive leader, she stands out for her ability to match technical strategies with practical, cutting-edge commercial solutions that meet on-the-ground needs.', E'Marilyn has over 20 years’ experience setting and applying health supply chain best practices globally and has led high-performing, multidisciplinary, cross-cultural teams of 15 to 150 staff, both in-country and at HQ. As Global Program Manager in Nigeria, she successfully transitioned to a new USAID contractor while handling non-performing subcontractors and managing compliance and risk for $60 million in health commodities across 10 locations.\\n\\nWith degrees in business administration, sociology, and Frenbusiness and development management. She works equally well Spanish, and can communicate proficiently in Portuguese.\\n\\nWith a career primarily devoted to supply chain management, Marilyn has led multimillion-dollar programs ensuring quality, compliance, and financial responsibility in ten countries. She worked on the Supply Chain Management System project for seven years at both the country and HQ levels and became a go-to resource for trainings on topics ranging from organizational culture to strategic health program quality improvement.', '-infinity');");
            migrationBuilder.Sql("INSERT INTO cms_content_leadership(\"Id\", \"Name\", \"Position\", \"Image\", \"Phone\", \"Email\", \"Bio\", \"Alignment\", \"CreateDate\") VALUES\r\n('0f43fb29-decf-4181-a7fc-0620e97c1e63', E'Jabu Nyenwa', E'Country Programs Director', E'data:image/png;base64,', E'+44 7502220553', E'jabulani.nyenwa@thepalladiumgroup.com', E'Jabulani “Jabu” Nyenwa has progressed over his 30-year career from a physician in his native Zimbabwe to a leader of some of the largest and most complex integrated health programs in Africa and Asia. As a long-term Palladium senior leader who is passionate about enabling people to access health services, he has implemented health service delivery, systems strengthening, and supply chain management programs in some of the world’s most challenging environments.', E'In addition to his 5-year career as a physician, Jabu brings 25 years of experience implementing public health programs across HIV; reproductive health; maternal, newborn, child, and adolescent health; and infectious diseases. This includes long-term roles in eight African countries and short-term technical assistance in 15 other low- to middle-income countries (LMICs). He has directly led large health programs in Nigeria with budgets over $100 million. He has managed and mentored country teams implementing health programs valued over $200 million, providing senior technical leadership and managerial oversight and support.\\n\\nHe is a medical doctor who has also earned advanced degrees in public health and business administration. Combined, these degrees provide him with a foundation of technical, strategic, and managerial understanding.\\n\\nJabu served as the in-country technical lead of USAID|DELIVER in Zimbabwe and has implemented several stand-alone supply chain activities, integrating them into broader health programs. His leadership during the transition of two incumbent health programs to Palladium was recognized by the client as being “commendably seamless” and without any gap in support. He also served as HQ Project Director for 10+ donorfunded health and development programs across Africa, supporting country teams to manage for results while meeting client expectations and requirements.', '-infinity');");
            migrationBuilder.Sql("INSERT INTO cms_content_leadership(\"Id\", \"Name\", \"Position\", \"Image\", \"Phone\", \"Email\", \"Bio\", \"Alignment\", \"CreateDate\") VALUES\r\n('aff69789-ed4d-49b6-af82-a506bd6c25ce', E'Sean Lockhead', E'Management, Information & Results Director', E'data:image/png;base64,', E'+ 1 609-947 2629', E'sean.lockhead@thepalladiumgroup.com', E'Sean was a key architect and thought leader for GS1, the gold standard for supply chain data interoperability, which has been vital to creating efficiencies in supply chain management. He is a technical and business leader with over 30 years of international experience, including on USAID global health supply chain activities. Sean has continuously demonstrated excellence in strategic planning, operational execution, product management, global standards development and implementation, and transaction-based supply chain initiatives.', E'Sean is an innovative technology leader who creates and manages information systems to improve efficiency and reliability. With expertise in data management, he provided LIT expertise on the GHSC-Procurement and Supply Management project to improve health supply chain processes. His leadership experience includes guiding teams of experts overseeing 112 country offices worldwide.\\n\\nSean has supplemented his graduate education in electrical engineering with over 14 certifications in leadership, management, design thinking, and teamwork from leading academic institutions and associations across the globe.\\n\\nHis 30+ years’ experience in implementing country-specific data management systems in both United States and LMIC settings has allowed him to create adaptive solutions to meet country needs that are tested, International Organization for Standardization-certified,and USAID-compliant. Having supported over 30 countries under the GHSC Procurement and Supply Management project, and has a deep understanding of the intersection of logistics, technology, and global health.', '-infinity');");
